import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
  form: {
    display: 'flex'
  },
  button: {
    margin: 'auto 0',
    borderRadius: '0 10px 0 0',
    height: 56
  }
});

export default useStyles;
